PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE ai_interactions (
                    id INTEGER PRIMARY KEY AUTOINCREMENT,
                    session_id INTEGER NOT NULL,
                    tg_user_id INTEGER,
                    cookie_id TEXT,
                    messages_count INTEGER DEFAULT 0,
                    topics TEXT,  -- JSON array of topics/tags
                    interaction_duration INTEGER,  -- в секундах
                    conversation_type TEXT,  -- 'expert', 'general', 'diagnostic'
                    started_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
                    ended_at TIMESTAMP,

                    FOREIGN KEY (session_id) REFERENCES site_sessions(id) ON DELETE CASCADE,
                    FOREIGN KEY (tg_user_id) REFERENCES users(user_id) ON DELETE SET NULL
                );
CREATE TABLE content_views (
                    id INTEGER PRIMARY KEY AUTOINCREMENT,
                    session_id INTEGER NOT NULL,
                    tg_user_id INTEGER,
                    cookie_id TEXT,
                    content_type TEXT NOT NULL,  -- 'section', 'article', 'video', 'pdf'
                    content_id TEXT NOT NULL,  -- ID контента
                    content_title TEXT,
                    section TEXT,  -- Раздел сайта
                    time_spent INTEGER,  -- Время просмотра в секундах
                    scroll_depth INTEGER,  -- Глубина прокрутки в %
                    completion_rate REAL,  -- Процент прочтения/просмотра
                    viewed_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,

                    FOREIGN KEY (session_id) REFERENCES site_sessions(id) ON DELETE CASCADE,
                    FOREIGN KEY (tg_user_id) REFERENCES users(user_id) ON DELETE SET NULL
                );
CREATE TABLE cta_clicks (
                    id INTEGER PRIMARY KEY AUTOINCREMENT,
                    session_id INTEGER NOT NULL,
                    tg_user_id INTEGER,
                    cookie_id TEXT,
                    cta_type TEXT NOT NULL,  -- 'call', 'telegram', 'whatsapp', 'email', etc.
                    cta_text TEXT,  -- Текст кнопки
                    cta_location TEXT,  -- Где расположена кнопка (header, footer, content, etc.)
                    previous_step TEXT,  -- Предыдущий шаг пользователя
                    step_duration INTEGER,  -- Время от предыдущего шага в секундах
                    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,

                    FOREIGN KEY (session_id) REFERENCES site_sessions(id) ON DELETE CASCADE,
                    FOREIGN KEY (tg_user_id) REFERENCES users(user_id) ON DELETE SET NULL
                );
CREATE TABLE diagnostics_results (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                tg_user_id INTEGER NOT NULL,
                cookie_id TEXT,
                result_json TEXT NOT NULL,  -- JSON с результатами диагностики
                completed_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,

                -- Ограничения
                FOREIGN KEY (tg_user_id) REFERENCES users(user_id) ON DELETE CASCADE,
                UNIQUE(tg_user_id, cookie_id)  -- Один пользователь - одни результаты
            );
CREATE TABLE game_actions (
                    id INTEGER PRIMARY KEY AUTOINCREMENT,
                    session_id INTEGER NOT NULL,
                    tg_user_id INTEGER,
                    cookie_id TEXT,
                    game_type TEXT NOT NULL,  -- 'calculator', 'quiz', 'assessment'
                    action_type TEXT NOT NULL,  -- 'start', 'complete', 'achievement', 'fail'
                    action_data TEXT,  -- JSON с данными действия
                    score INTEGER,
                    achievement TEXT,
                    duration INTEGER,  -- Время действия в секундах
                    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,

                    FOREIGN KEY (session_id) REFERENCES site_sessions(id) ON DELETE CASCADE,
                    FOREIGN KEY (tg_user_id) REFERENCES users(user_id) ON DELETE SET NULL
                );
CREATE TABLE site_events (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                session_id INTEGER NOT NULL,
                tg_user_id INTEGER,  -- Может быть NULL
                event_type TEXT NOT NULL,  -- click, scroll, page_view, cta_click, etc.
                event_name TEXT NOT NULL,  -- конкретное название события
                page TEXT,                 -- страница где произошло событие
                metadata TEXT,             -- JSON с дополнительными данными
                created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP, event_category TEXT, event_subtype TEXT, element_id TEXT, element_type TEXT, section TEXT, scroll_depth INTEGER, time_spent INTEGER, interaction_count INTEGER, previous_event_id INTEGER, step_number INTEGER, completion_rate REAL, error_message TEXT, custom_data TEXT,

                -- Ограничения
                FOREIGN KEY (session_id) REFERENCES site_sessions(id) ON DELETE CASCADE,
                FOREIGN KEY (tg_user_id) REFERENCES users(user_id) ON DELETE SET NULL
            );
CREATE TABLE site_sessions (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                cookie_id TEXT NOT NULL,
                tg_user_id INTEGER,  -- Может быть NULL если пользователь не из Telegram
                session_start TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
                session_end TIMESTAMP,
                user_agent TEXT,
                ip TEXT, source TEXT, utm_source TEXT, utm_medium TEXT, utm_campaign TEXT, utm_term TEXT, utm_content TEXT, referrer TEXT, device_type TEXT, device_model TEXT, browser TEXT, os TEXT, screen_resolution TEXT, geo_country TEXT, geo_city TEXT, geo_region TEXT, page_id TEXT, entry_page TEXT, exit_page TEXT, session_duration INTEGER, page_views INTEGER DEFAULT 0, events_count INTEGER DEFAULT 0, utm_params TEXT,

                -- Ограничения
                FOREIGN KEY (tg_user_id) REFERENCES users(user_id) ON DELETE SET NULL
            );
CREATE TABLE user_identities (
                id INTEGER PRIMARY KEY AUTOINCREMENT,
                tg_user_id INTEGER,  -- Ссылка на users.user_id
                cookie_id TEXT,      -- Cookie ID с сайта
                source TEXT CHECK(source IN ('telegram', 'site', 'miniapp')) NOT NULL,
                linked_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP, miniapp_id TEXT,

                -- Ограничения
                FOREIGN KEY (tg_user_id) REFERENCES users(user_id) ON DELETE CASCADE,
                UNIQUE(tg_user_id, cookie_id)  -- Один пользователь не может иметь дублирующие связи
            );
CREATE TABLE users (
            user_id INTEGER PRIMARY KEY,
            username TEXT,
            first_name TEXT,
            last_name TEXT,
            has_started_diagnostics BOOLEAN DEFAULT 0,
            first_reminder_sent BOOLEAN DEFAULT 0,
            second_reminder_sent BOOLEAN DEFAULT 0,
            started_at TIMESTAMP,
            diagnostics_started_at TIMESTAMP,
            created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
            updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
        , diagnostics_completed_at TIMESTAMP);
CREATE INDEX idx_user_identities_tg_user ON user_identities(tg_user_id);
CREATE INDEX idx_user_identities_cookie ON user_identities(cookie_id);
CREATE INDEX idx_site_sessions_cookie ON site_sessions(cookie_id);
CREATE INDEX idx_site_sessions_tg_user ON site_sessions(tg_user_id);
CREATE INDEX idx_site_sessions_start ON site_sessions(session_start);
CREATE INDEX idx_site_events_session ON site_events(session_id);
CREATE INDEX idx_site_events_tg_user ON site_events(tg_user_id);
CREATE INDEX idx_site_events_type ON site_events(event_type);
CREATE INDEX idx_site_events_created ON site_events(created_at);
CREATE INDEX idx_diagnostics_tg_user ON diagnostics_results(tg_user_id);
CREATE INDEX idx_user_identities_miniapp ON user_identities(miniapp_id);
CREATE INDEX idx_site_sessions_source ON site_sessions(source);
CREATE INDEX idx_site_sessions_device ON site_sessions(device_type);
CREATE INDEX idx_site_events_category ON site_events(event_category);
CREATE INDEX idx_diagnostics_cookie ON diagnostics_results(cookie_id);
CREATE INDEX idx_ai_session ON ai_interactions(session_id);
CREATE INDEX idx_ai_tg_user ON ai_interactions(tg_user_id);
CREATE INDEX idx_ai_type ON ai_interactions(conversation_type);
CREATE INDEX idx_cta_session ON cta_clicks(session_id);
CREATE INDEX idx_cta_tg_user ON cta_clicks(tg_user_id);
CREATE INDEX idx_cta_type ON cta_clicks(cta_type);
CREATE INDEX idx_content_session ON content_views(session_id);
CREATE INDEX idx_content_tg_user ON content_views(tg_user_id);
CREATE INDEX idx_content_type ON content_views(content_type);
CREATE INDEX idx_game_session ON game_actions(session_id);
CREATE INDEX idx_game_tg_user ON game_actions(tg_user_id);
CREATE INDEX idx_game_type ON game_actions(game_type);
DELETE FROM "sqlite_sequence";
COMMIT;
